// App.js
import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Navbar from './components/Navbar';
import Summary from './components/Summary';
import Board from './components/Board'; // assuming you have a Board component
import AddTask from './components/AddTask'; // assuming you have an AddTask component
import Contacts from './components/Contacts'; // assuming you have a Contacts component

function App() {
    return (
        <Router>
            <Navbar />
            <Switch>
                <Route exact path="/" component={Summary} />
                <Route path="/board" component={Board} />
                <Route path="/add-task" component={AddTask} />
                <Route path="/contacts" component={Contacts} />
                <Route path="/logout" render={() => <div>Logout Page</div>} />
            </Switch>
        </Router>
    );
}

export default App;
